import React, {useState , useEffect} from 'react'
import axios from 'axios'
const Home = () => {
    const [data , setData] = useState([])
    useEffect(()=>{
        axios.get('http://localhost:5000/')
        .then(res => setData(res.data))
        .catch(error => console.log(error))
    },[])
  return (
    <div>Home</div>
  )
}

export default Home
